import Link from 'next/link';


export default function Index() {
    return (
        <div>
            <Link href="/yogaexercises">
                <a title="Yoga Exercises For Beginners">Yoga Exercises</a>
            </Link>
            <Link href="/about">
                <a>About</a>
            </Link>
        </div>
    )
}
